DROP TABLE IF EXISTS `form_field`;
CREATE TABLE `form_field` (
  `id` bigint(20) NOT NULL auto_increment,
  `label` varchar(255) NOT NULL default '',
  `type` varchar(255) NOT NULL default '',
  `required` tinyint(1) NOT NULL default '0',
  `min_value` int(11) default NULL,
  `max_value` int(11) default NULL,
  `units` varchar(255) default NULL,
  `display_order` int(11) default NULL,
  `patient_property` varchar(255) default NULL,
  `is_enabled` tinyint(1) NOT NULL default '0',
  `last_modified` datetime default NULL,
  `created` datetime default NULL,
  `last_modified_by` varchar(255) default NULL,
  `created_by` varchar(255) default NULL,
  `site_id` bigint(20) default NULL,
  `shared` tinyint(1) NOT NULL default '0',
  `star_schema_name` varchar(255) default NULL,
  `encounter_record_property` varchar(255) NOT NULL default '',
  `patient_status_property` varchar(255) default NULL,
  `patient_lab_property` varchar(255) default NULL,
  PRIMARY KEY  (`id`),
  KEY `FKF276DBF7D2B7913` (`site_id`),
  KEY `FKF276DBF3E8F4D64` (`last_modified_by`),
  KEY `FKF276DBF51A3A90E` (`created_by`),
  CONSTRAINT `FKF276DBF3E8F4D64` FOREIGN KEY (`last_modified_by`) REFERENCES `user_group_membership` (`id`),
  CONSTRAINT `FKF276DBF51A3A90E` FOREIGN KEY (`created_by`) REFERENCES `user_group_membership` (`id`),
  CONSTRAINT `FKF276DBF7D2B7913` FOREIGN KEY (`site_id`) REFERENCES `site` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

